import React from "react";

export default function TableItem({ tableData }) {
  console.log(tableData);
  const birds = [];

  tableData.slice(0, 31).map(element => {
      birds.push(<div key={element.speciesCode+element.obsDt}>
        <div>{element.comName}</div>
    </div>)
     
  });
  
  return (
    <div>{birds}</div>
  );
}
